import  React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Manager from './components/addManager';

function App() {

    return (
        <Router>
            <Navbar />
            <Switch>
                <Route exact path="/" component={Manager} />

            </Switch>
        </Router>
    );
}

export default App;
